import React, { Component } from 'react'
import UserServer from "../../server/UserServer"

export default class SignUp extends Component {
    constructor(props) {
        super(props)

        this.state = {
            email: "",
            password: "",
            password_confirmation: ""
        }
    }

    userInput = (event) => {
        this.setState({ [event.target.name]: event.target.value });
    }

    render() {
        return (
            <div>
                <h2>Sign Up</h2>
            </div>
        )
    }
}
